import {
  Theme,
  createStyles
} from "@material-ui/core/styles";

const styles = (theme: Theme) => createStyles({
  activityContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  }
})

export default styles
